explanationOfDynamicParameters=\u0909\u092A\u092F\u094B\u0917 \u0917\u0924\u093F\u0936\u0940\u0932 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0927\u094D\u0935\u091C \u0928\u093F\u0930\u094D\u0927\u093E\u0930\u093F\u0924 \u0915\u0930\u0924\u093E \u0939\u0948 \u0915\u093F \u0910\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u092A\u094D\u0930\u0938\u0902\u0917 \u0915\u0947 \u090F\u0915\u0932 \u092E\u093E\u0928 \u092B\u093F\u0932\u094D\u091F\u0930\u094B\u0902 \u0914\u0930 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u094B \u0915\u093F\u0938 \u0924\u0930\u0939 \u0928\u0947\u0935\u093F\u0917\u0947\u0936\u0928 \u0932\u0915\u094D\u0937\u094D\u092F \u0915\u094B \u0938\u094C\u0902\u092A \u0926\u093F\u092F\u093E \u091C\u093E\u0924\u093E \u0939\u0948. \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u092A\u094D\u0930\u0938\u0902\u0917 \u092E\u0947\u0902 \u0938\u092D\u0940 \u092B\u093C\u093F\u0932\u094D\u091F\u0930 \u0914\u0930 \u0935\u093F\u0936\u094D\u0932\u0947\u0937\u0923 \u091A\u0930\u0923\u094B\u0902 \u092E\u0947\u0902 \u091A\u092F\u0928 \u0938\u0947 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u092E\u093E\u0928 \u0914\u0930 \u0907\u0928 \u0932\u0949\u0928\u094D\u091A\u093F\u0902\u0917 \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0938\u0947 \u0906\u0928\u0947 \u0935\u093E\u0932\u0947 \u092B\u093C\u093F\u0932\u094D\u091F\u0930 \u092C\u093E\u0930 \u092D\u0940 \u0936\u093E\u092E\u093F\u0932 \u0939\u094B\u0924\u0947 \u0939\u0948\u0902. \n\n\u0927\u094D\u0935\u091C \u0921\u093F\u092B\u093C\u0949\u0932\u094D\u091F \u0930\u0942\u092A \u0938\u0947 \u0938\u0947\u091F \u0928\u0939\u0940\u0902 \u0915\u093F\u092F\u093E \u0917\u092F\u093E \u0939\u0948, \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u092A\u094D\u0930\u0938\u0902\u0917 \u0905\u0928\u0928\u094D\u092F \u0930\u0942\u092A \u0938\u0947 x\u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0938\u094D\u0925\u093F\u0924\u093F \u0915\u0902\u091F\u0947\u0928\u0930 \u0915\u0947 \u092E\u093E\u0927\u094D\u092F\u092E \u0938\u0947 \u0928\u0947\u0935\u093F\u0917\u0947\u0936\u0928 \u0932\u0915\u094D\u0937\u094D\u092F \u0915\u094B \u0938\u094C\u092A\u093E \u0917\u092F\u093E \u0939\u0948.\n\n\u0928\u0947\u0935\u093F\u0917\u0947\u0936\u0928 \u0932\u0915\u094D\u0937\u094D\u092F \u092A\u0930 \u0928\u093F\u0930\u094D\u092D\u0930, \u092A\u094D\u0930\u0938\u0902\u0917 URL \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u0947 \u092E\u093E\u0927\u094D\u092F\u092E \u0938\u0947 \u090F\u0915\u094D\u0938\u092A\u094B\u091C\u093C \u0915\u093F\u092F\u093E \u091C\u093E\u0928\u093E \u0939\u0948. \u092F\u0939 \u0915\u0947\u0938 \u0924\u092C \u0939\u094B \u0938\u0915\u0924\u093E \u0939\u0948, \u091C\u092C \u0928\u0947\u0935\u093F\u0917\u0947\u0936\u0928 \u0932\u0915\u094D\u0937\u094D\u092F \u0939\u094B, \u0909\u0926\u093E\u0939\u0930\u0923 \u0915\u0947 \u0932\u093F\u090F x-\u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0938\u0947 \u0909\u092A\u092D\u094B\u0917 \u092A\u094D\u0930\u0938\u0902\u0917 \u0915\u0930\u0928\u0947 \u092E\u0947\u0902 \u0905\u0938\u092E\u0930\u094D\u0925 \u092F\u093E \u091C\u092C \u0928\u0947\u0935\u093F\u0917\u0947\u0936\u0928 \u0932\u0915\u094D\u0937\u094D\u092F \u0915\u0947 \u0907\u0930\u093E\u0926\u0947 \u0905\u0928\u093F\u0935\u093E\u0930\u094D\u092F \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0939\u0948 \u091C\u094B URL \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u0947 \u0930\u0942\u092A \u092E\u0947\u0902 \u092A\u094D\u0930\u0926\u093E\u0928 \u0915\u093F\u092F\u093E \u091C\u093E\u0928\u093E \u0939\u0948. \u091C\u092C \u0909\u092A\u092F\u094B\u0917 \u0917\u0924\u093F\u0936\u0940\u0932 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0927\u094D\u0935\u091C\u093C \u0938\u0947\u091F \u0939\u0948\u0902, \u0924\u092C \u0938\u092D\u0940 \u090F\u0915\u0932 \u092E\u093E\u0928 \u092B\u093C\u093F\u0932\u094D\u091F\u0930 \u0914\u0930 \u092A\u094D\u0930\u0938\u0902\u0917 \u0938\u0947 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u092D\u0940 URL \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u0947 \u0930\u0942\u092A \u092E\u0947\u0902 \u090F\u0915\u094D\u092A\u094B\u091C\u093C \u0915\u093F\u092F\u093E \u0917\u092F\u093E \u0939\u0948. \u0915\u0943\u092A\u092F\u093E \u0927\u094D\u092F\u093E\u0928 \u0926\u0947 \u0915\u093F \u092F\u0947 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u0949\u0932 \u0915\u093F\u090F \u0917\u090F \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0915\u093E URL \u092E\u0947\u0902 \u0909\u0924\u094D\u092A\u0928\u094D\u0928 \u0939\u094B\u0917\u093E \u0914\u0930, \u0907\u0938\u0932\u093F\u090F, \u0921\u0947\u091F\u093E \u0938\u0941\u0930\u0915\u094D\u0937\u093E \u0914\u0930 \u0917\u094B\u092A\u0928\u0940\u092F\u0924\u093E \u092A\u0939\u0932\u0942 \u092A\u0930 \u0935\u093F\u091A\u093E\u0930 \u0915\u093F\u092F\u093E \u091C\u093E\u0928\u093E \u0939\u0948.\n\n\u0915\u0943\u092A\u092F\u093E \u0927\u094D\u092F\u093E\u0928 \u0926\u0947\u0902 \u0915\u093F \u092F\u0947 \u092A\u0948\u0930\u093E\u092E\u0940\u091F\u0930 \u0915\u0949\u0932 \u0915\u093F\u092F\u093E \u0917\u092F\u093E \u090F\u092A\u094D\u0932\u093F\u0915\u0947\u0936\u0928 \u0915\u093E URL \u092E\u0947\u0902 \u0939\u094B\u0917\u093E \u0914\u0930, \u0907\u0938\u0932\u093F\u090F, \u0921\u0947\u091F\u093E \u0938\u0941\u0930\u0915\u094D\u0937\u093E \u0914\u0930 \u0917\u094B\u092A\u0928\u0940\u092F\u0924\u093E \u092A\u0939\u0932\u0942 \u092A\u0930 \u0935\u093F\u091A\u093E\u0930 \u0915\u093F\u092F\u093E \u091C\u093E\u0928\u093E \u0939\u0948.
